import React from "react";

export const Category = ({ category, icon: Icon }) => {
  return (
    <div
      className={`flex-col gap-4 rounded-2xl bg-purple-600 p-4 aspect-[8/7] w-40`}
    >
      <div className="flex">
        {/* <span className={`bg-white p-2 rounded-full text-${category.color}-400`}> */}
        <span className={`bg-white p-2 rounded-full text-purple-600`}>
          <Icon />
        </span>
      </div>
      <div className="flex flex-col gap-0 font-bodyFont">
        <span className="text-base text-white">{category.name}</span>
        <span className=" text-gray-200 text-sm">{category.files} files</span>
      </div>
    </div>
  );
};
